(function($) {
  'use strict';
  var settings,
    defaults = {
      appName: 'engage',
      globalHeader: '.header',
      title: 'Welcome',
      content:
        'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Vel doloremque, architecto voluptatem. Assumenda tenetur quibusdam dolorum nulla esse! Impedit illo suscipit aliquid, distinctio nam tenetur harum sapiente ipsum nihil rem?'
    },
    banner,
    bannerH,
    globalHeader,
    isHidden = false;

  var refineStyles = function() {
      if (!isHidden && $(window).width() > 768) {
        $('body').css({
          'margin-top': bannerH + 'px'
        });
        $('.navbar-fixed-top').css({
          'margin-top': bannerH + 'px'
        });
        $('.navbar-static-side').css({
          'margin-top': bannerH + 70 + 'px'
        });
        globalHeader.css({
          transition: 'all 0.3s',
          top: bannerH + 'px'
        });
        banner.css({
          transform: 'translateY(0px)'
        });
      } else {
        $('body').css({
          'margin-top': ''
        });
        $('.navbar-fixed-top, .navbar-static-side').css({
          'margin-top': ''
        });
        globalHeader.css({
          top: ''
        });
        banner.css({
          transform: 'translateY(-' + bannerH + 'px)'
        });
        $('.callout').css('top', '142px');
      }
    },
    saveState = function() {
      localStorage.setItem(settings.appName + '-tiny-banner-closed', 'true');
      isHidden = true;
    },
    loadState = function() {
      if (
        localStorage.getItem(settings.appName + '-tiny-banner-closed') !==
        'true'
      ) {
        isHidden = false;
      } else {
        isHidden = true;
      }
    },
    init = function(ele) {
      var css =
        '<style>body{transition:all 0.3s}.tiny-banner{width:100%;display:table;min-height:70px;position:fixed;top:0;left:0;right:0;z-index:999;background:#0085F6;box-sizing:border-box;transition:all 0.21s;transform:translateY(-300px)}.tiny-banner>div{display:table-cell;height:100%;box-sizing:border-box;padding:0 10px;vertical-align:middle}.tiny-banner>div p,.tiny-banner>div a{color:#fff;margin:0}.tiny-banner .logo{width:20%;height:auto}.tiny-banner .logo p{font-size:20px;font-weight:700;text-align:center}.tiny-banner .content{width:75%}.tiny-banner .content a{text-decoration:underline}.tiny-banner .buttons{width:5%;text-align:center}.tiny-banner .buttons .hide-banner{color:#005DB5}</style>';
      $('head').append(css);

      banner = $(
        "<div class='tiny-banner'> <div class='logo'><p>" + settings.title +
          "</p></div><div class='content'> <p>" + settings.content +
          "</p></div><div class='buttons'><a class='hide-banner' data-action='hide-banner'><i class='fa fa-times' aria-hidden='true'></i></a> </div></div>"
      );
      $(ele).prepend(banner);
      banner.find("a[data-action='hide-banner']").on('click', function(e) {
        e.preventDefault();
        isHidden = true;
        saveState();
        refineStyles();
      });
      globalHeader = $(settings.globalHeader);

      var debouncedRefineStyles = window._.throttle(refineStyles, 200);
      loadState();

      $(window).on('resize', function() {
        bannerH = banner.height();
        debouncedRefineStyles();
      }).trigger('resize');
    };

  $.fn.tinyban = function(options) {
    settings = $.extend(true, defaults, options);
    init(this);
  };
}(jQuery));
