define('Tp.Employee.DarkFeatures', [
  'jquery', 'underscore'
], function($, _) {
  "use strict";
  var darkFeatures = {};

  function getFeature(key, asynch, onSuccess) {
    return $.ajax({
      type: 'GET',
      async: asynch,
      cache: true,
      dataType: 'json',
      url: '/api/web/dark_features/' + key,
      success: onSuccess,
      statusCode: {
        404: function() {
          darkFeatures[key] = false;
        }
      }
    });
  }

  var DarkFeature = Object.create(null);

  DarkFeature.preLoad = _.partial(getFeature, '', true, function(features) {
    darkFeatures = features;
  });

  /**
   * Call onFeature callback is the dark-feature of given key is enabled for the current_organization.
   **/
  DarkFeature.ifEnabled = function(key, onFeature) {
    if (_.has(darkFeatures, key)) {
      if (darkFeatures[key]) {
        onFeature();
      }
    } else {
      getFeature(key, true, function(feature) {
        if (feature.enabled) {
          onFeature();
        }
        darkFeatures[key] = feature.enabled;
      });
    }
  };

  DarkFeature.isEnabled = function(key) {
    if (!_.has(darkFeatures, key)) {
      getFeature(key, false, function(feature) {
        darkFeatures[key] = feature.enabled;
      });
    }
    return darkFeatures[key];
  };

  return DarkFeature;
});
define('Tp.Employee.EventBusUtils', [
  'jquery',
  'backbone',
  'underscore'
], function ($, Backbone, _) {
  var CUSTOM_EVENT = "custom_event";
  var AppEventBus = _.extend({}, Backbone.Events);
  var utils = {};

  utils.triggerEvent = function (event, data) {
    AppEventBus.trigger(event, data);
  };

  utils.subscribeEvent = function (event, callback, object) {
    AppEventBus.on(event, callback, object);
  };

  utils.unsubscribeEvent = function (event, callback, object) {
    AppEventBus.off(event, callback, object);
  };

  utils.fireCustomEvent = function (data) {
    utils.triggerEvent(CUSTOM_EVENT, data);
  };

  utils.subscribeCustomEvent = function (callback, object) {
    utils.subscribeEvent(CUSTOM_EVENT, callback, object);
  };

  utils.unsubscribeCustomEvent = function (callback, object) {
    utils.unsubscribeEvent(CUSTOM_EVENT, callback, object);
  };

  return utils;
});
