define('Tp.Employee.Tracking', [
  'jquery',
  'underscore',
  'Tp.Employee.GlobalState'
], function($, _, GlobalState) {
  "use strict";

  var defaultOptions = {
    action: 'Click',
    category: 'LIVEpulse'
  };

  function trackEvent(label, options) {
    var trackOptions = _.extend({}, defaultOptions, options);
    var dashboard = GlobalState.getDashboardData();

    var dataLayer = window.dataLayer || null;
    if (dataLayer) {
      dataLayer.push({
        'event': 'tinypulse.general.event',
        'generalEventCategory': trackOptions.category,
        'generalEventAction': trackOptions.action,
        'generalEventLabel': label,
        'orgId': dashboard.receiver.current_org_id,
        'orgName': dashboard.receiver.current_org_name,
        'receiverId': dashboard.receiver.receiver_id,
        'receiverState': GlobalState.loginState()
      });
    }
  }

  return {
    trackEvent: trackEvent,

    setupTracking: function($page) {
      var trackingHandler = function(event){
        var target = event.currentTarget;
        var classNames = $(target).attr("class").toString().split(' ');
        $.each(classNames, function (i, className) {
          if (className.substring(0, 'js-tracking'.length) === 'js-tracking') {
            var eventLabel = className.substr(12);
            trackEvent(eventLabel);
          }
        });
      };
      $page.find("[class*='js-tracking']:not(.js-tracked)").addClass('js-tracked').click(trackingHandler);
    }
  };
});
define('Tp.Employee.UrlParamsUtil', [
  'jquery',
  'underscore'
], function ($, _) {
  "use strict";

  function UrlParamsUtil() {

  }

  UrlParamsUtil.prototype = {
    constructor: UrlParamsUtil,
    getParams: function (url) {
      var ampersand = "&";
      if (_.isUndefined(url)) {
        url = location.search;
      } else if (url[0] !== '?') {
        url = '?'.concat(url);
      }

      return _.object(
        _.compact(
          _.map(
            url.slice(1).split(ampersand), function (item) {
              if (item) {
                return item.split('=');
              }
            }
          )
        )
      );
    }
  };
  return UrlParamsUtil;

});
