define('Tp.Employee.SignupPopoverView', [
  'jquery',
  'backbone',
  'underscore',
  'toastr',
  'Tp.Employee.Api',
  'Tp.Employee.LoaderView',
  'Tp.Employee.GlobalState',
  'Tp.Employee.RouterHelper',
  'Tp.Employee.AuthenticateUtils',
  'Tp.Employee.EventBusUtils',
  'Tp.Employee.Constants'
], function ($, Backbone, _, toastr, Api, LoaderView, GlobalState, RouterHelper, AuthenticateUtils, EventBusUtils, Constants) {

  return Backbone.View.extend({
    el: '#page-wrapper',
    template: JST['employee/home/surveys/signup_popover/signup_popover'],
    events: {
      "click .modal.signup-popover .btn-signup-form": "signup",
      "keyup .modal.signup-popover .signup .user-password": "handleEnterKeyPress",
      "keyup .modal.signup-popover .signup .user-confirm-password": "handleEnterKeyPress",
      "click .modal.signup-popover .btn-close": "_close"
    },

    initialize: function () {
      this.dashboard = GlobalState.getDashboardData();
      this.loader = new LoaderView();
    },

    handleEnterKeyPress: function (event) {
      if (event.keyCode == 13 && this._validate(this.$el.find(".signup"))) {
        this.$el.find(".flex-btns .btn-signup-form").click();
      }
    },

    signup: function () {
      var $container = this.$el.find(".signup");
      if (!this._validate($container)) {
        return;
      }

      var firstName = $container.find(".first-name").val();
      var lastName = $container.find(".last-name").val();
      var password = $container.find(".user-password").val();
      var data = {
        email: this.dashboard.receiver.email,
        password: password,
        first_name: firstName,
        last_name: lastName
      };

      this.loader.show(this.$el, {
        fixedPosition: true
      });

      Api.signup(this.dashboard.responses[0].response_token, JSON.stringify(data)).done(_.bind(function (respone) {
        if (respone.status === "OK" || respone.status === 200) {
          toastr.success(I18n.t('messages.authentication.signup.success'));
          GlobalState.setDashboardData(respone.dashboard);
          AuthenticateUtils.signIn(data);
          EventBusUtils.triggerEvent(Constants.EVENTS.ON_LOGGED_IN);

          this.$el.find('.modal.signup-popover').modal('hide');
          return;
        }

        toastr.error(respone.message);
      }, this)).fail(function (xhr) {
        toastr.error(JSON.parse(xhr.responseText).message);
      }).always(_.bind(function () {
        this.loader.hide();
      }, this));
    },

    _validate: function (container) {

      var email = container.find(".user-email").val();
      var firstName = container.find(".first-name").val();
      if (firstName.trim().length === 0) {
        toastr.error(I18n.t('messages.authentication.signup.errors.firstNameRequire'));
        return false;
      }
      var lastName = container.find(".last-name").val();
      if (lastName.trim().length === 0) {
        toastr.error(I18n.t('messages.authentication.signup.errors.lastNameRequire'));
        return false;
      }

      var password = container.find(".user-password");
      if (password.val().trim().length === 0) {
        toastr.error('messages.authentication.signup.errors.passwordRequire');
        return false;
      }

      if (password[0].checkValidity() === false) {
        toastr.error('messages.authentication.signup.errors.invalidPassowrd');
        password.focus();
        return false;
      }

      return true;
    },

    render: function () {
      this.$el.append(this.template({
        email: this.dashboard.receiver.email,
        first_name: this.dashboard.receiver.first_name,
        last_name: this.dashboard.receiver.last_name
      }));

      this.$el.find('.modal.signup-popover').modal('show');

      GlobalState.setHideSignupPopover(true);
    },

    _close: function (e) {
      e.preventDefault();
      this.$el.find('.modal.signup-popover').modal('hide');
    }
  });
});
