      container.find(".js-cheersitem-form-photoupload").removeClass("js-disabled");
      container.find(".cheer-hide").prop("checked", false);
      container.find(".cheer-anonymous").prop("checked", false);
      container.find(".media-image").attr("src", "");
      container.find(".amount").val("");
      container.find(".btn-remove-giftcard").hide();
      container.find('.tango-preview img').hide();
      container.find('.giftcard-value-panel').hide();
      container.find('.giftcard-instruction').hide();
      container.find('.media-preview').hide();
      container.find('.tango-preview').hide();
      container.find('.js-cheersitem-form-tinygift').removeClass('disabled');

      this.cheersItem.removeMediaFor(this.$el.find('.js-cheersitem'));

