define('Tp.Employee.Collections.InboxItems', [
  'jquery',
  'underscore',
  'backbone',
  'Tp.Employee.Constants',
  'Tp.Employee.GlobalState'
], function ($, _, Backbone, Constants, GlobalState) {

  return Backbone.Collection.extend({

    initialize: function (options) {
      options = options || {};

      this.responseToken = options.responseToken;
      this.currentPage = 1;
    },

    url: function () {
      var filter = GlobalState.getParamFromUrl(Constants.INBOX.FILTER_KEY);
      filter = filter === 'all' ? null : filter;

      var params = {
        response_token: this.responseToken,
        page: this.currentPage,
        per_page: Constants.INBOX.ITEMS_PER_PAGE
      };

      if (filter) {
        _.extendOwn(params, {
          filter: filter
        });
      }

      return "/api/v1/employee/inboxes?" + $.param(params);
    },

    parse: function (rawData) {
      var data = rawData.inbox_items;
      if (!data) {
        return [];
      }

      for (var index = 0; index < data.length; index++) {
        if (data[index].cheer_token) {
          data[index].source_type = Constants.INBOX.ITEM_TYPE.CHEER;
        }
      }

      return data;
    },

    setNextPage: function () {
      this.currentPage += 1;
    },

    setPage: function (page) {
      this.currentPage = page;
    }
  });
});
define('Tp.Employee.Views.InboxItemsView', [
  'backbone',
  'Tp.Employee.GlobalState',
  'Tp.Employee.Views.CheerHistoryView',
  'Tp.Employee.Views.FeedItemView',
  'Tp.Employee.Constants',
  'Tp.Employee.UrlParamsUtil',
  'Tp.Employee.Views.EmptyView'
], function (Backbone, GlobalState, CheerHistoryView, FeedItemView, Constants, UrlParamsUtil, EmptyView) {
  return Backbone.Marionette.CollectionView.extend({
    tagName: 'div',
    className: 'js-isotope-base grid',
    collectionEvents: {
      "sync": "renderItems"
    },
    initialize: function () {
      this.itemIndex = 0;
      this.dashboard = GlobalState.getDashboardData();
    },
    emptyView: EmptyView,
    childViewOptions: function () {
      this.urlParams = new UrlParamsUtil().getParams();

      var options = {};

      if (this.dashboard.responses[0].id && !this.dashboard.cheer_only) {
        options = {
          message: 'Start filling up this inbox by responding to your TINYpulse survey!',
          buttonMessage: 'Respond now',
          buttonLink: location.origin + '/' + Constants.ROOT_URL
        };

        $.extend(options, this.options);
      } else {
        options = {
          message: 'Cheers are a simple and easy way to recognize people around you for a job well done. Show people you appreciate their effort by sending your first Cheer.',
          buttonMessage: 'Send Cheers',
          buttonLink: 'cheers/send'
        };

        $.extend(options, this.options);
      }

      if (this.urlParams.filter === 'Response' && this.dashboard.responses[0].id) {
        options = {
          message: 'You haven\'t responded to a survey yet',
          buttonMessage: 'Respond now',
          buttonLink: location.origin + '/' + Constants.ROOT_URL
        };
      } else if (this.urlParams.filter === 'Response' && !this.dashboard.responses[0].id) {
        options = {
          message: "You can't respond to anonymous TINYpulse Engage surveys yet, but you can send an anonymous suggestion to your leaders in the meantime.",
          buttonMessage: 'Give a suggestion',
          buttonLink: 'suggestions/add'
        };
      } else if (this.urlParams.filter === 'Suggestion' && !this.dashboard.no_suggestion) {
        options = {
          message: 'You haven\'t given any suggestions.',
          buttonMessage: 'Give a suggestion',
          buttonLink: 'suggestions/add'
        };
      } else if (this.urlParams.filter === 'Cheer') {
        var message = (!this.dashboard.responses[0].id && this.urlParams.cheer_batch_token) ? 'Cheers are a simple and easy way to recognize people around you for a job well done. Show people you appreciate their effort by sending your first Cheer.' : 'You haven\'t sent or received any Cheers.';
        options = {
          message: message,
          buttonMessage: 'Send Cheers',
          buttonLink: 'cheers/send'
        };

        $.extend(options, this.options);
      }

      return options;
    },
    renderItems: function () {
      var view;

      if (this.collection.isEmpty() && !this.children.length) {
        this.destroyChildren();
        return;
      }
      var urlParams = new UrlParamsUtil().getParams();
      var feedItemId = urlParams.feedItemId;
      for (var index = 0; index < this.collection.models.length; index++) {
        view = null;
        var model = this.collection.models[index];
        if (model.attributes.source_type == Constants.INBOX.ITEM_TYPE.CHEER) {
          view = CheerHistoryView;
        } else {
          view = FeedItemView;

          if (feedItemId && model.get('id') === parseInt(feedItemId, 10) && GlobalState.isFirstView()) {
            model.set('feedIdFromNotification', feedItemId);
          }
        }

        if (view) {
          Backbone.Marionette.CollectionView.prototype.addChild.apply(this, [model, view, this.itemIndex]);
          this.itemIndex++;
        }
      }
    }

  });
});
