define('Tp.Employee.InitialSurveysCheerOnlyView', [
  'jquery',
  'underscore',
  'backbone',
  'toastr',
  'Tp.Employee.Api',
  'Tp.Employee.LoaderView',
  'Tp.Employee.GlobalState',
  'Tp.Employee.Factories',
  'Tp.Employee.CheersPartialView',
  'Tp.Employee.Utils',
  'Tp.Employee.RouterHelper',
  'Tp.Employee.Constants',
  'Tp.Employee.Tracking'
], function($, _, Backbone, toastr, Api, LoaderView, GlobalState, Factories, CheersPartialView, Utils, RouterHelper, Constants, Tracking) {
  "use strict";

  return Backbone.View.extend({
    el: '.layout-hook',
    template: {
      base: JST['employee/initial_surveys/initial_surveys_cheer_only'],
      anonymityModal: JST['employee/common/templates/learnmore_anonymity_modal']
    },

    events: {
      "click #js-form-sendfeedback": "sendFeedback",
      "click .happiness .btn-white": "scaleSelected",
      "keyup .search-field input": "loadReceiver",
      "click .survey-question .yes-btn": "yesButton",
      "click .survey-question .no-btn": "noButton",
      "focusin #password": "enableShowHidePassword",
      "focusin .receiver-email": "enableShowHidePassword"
    },

    initialize: function() {
      this.loader = new LoaderView();
    },

    render: function(options) {
      options = options || {};

      var signupToken = GlobalState.getParamFromUrl('signup_token');
      Api.getInitialSurveysData(signupToken).done(_.bind(function(data) {
          if (data.is_valid) {
            this.$el.html($(this.template.base()));

            Factories.prepareModal({
              id: 'anonymity',
              $container: this.$el,
              modalTemplate: this.template.anonymityModal
            });

            this.cheersPartialView = new CheersPartialView({
              signup_token: signupToken
            });
            this.cheersPartialView.render();

            this.$el.find(".js-tooltip").tooltip();
            this.data = data;
          }
        }, this))
        .always(_.bind(function() {

        }, this));

      if (_.isFunction(options.loadComplete)) {
        options.loadComplete();
      }

      Tracking.setupTracking(this.$el);
    },

    enableShowHidePassword: function(event) {
      // $('#password').hidePassword(true);
      $('#password').hideShowPassword({
        show: false,
        innerToggle: true,
        toggle: {
          className: 'btn btn-primary btn-xs engage-password-toogle',
          styles: {
            'margin-right': '6px'
          }
        }
      });
    },

    sendFeedback: function(event) {
      event.preventDefault();

      $(event.target).prop('disabled', true);

      var surveyForm = this.$el.find(".survey-form");

      if (!this._validateEmailAndPassword(surveyForm)) {
        $(event.target).prop('disabled', false);
        return;
      }

      var receiverEmail = surveyForm.find('.receiver-email').val();
      var receiverPassword = surveyForm.find('.receiver-password').val();

      var suggestions = [];
      var suggestionMessage = surveyForm.find(".suggestion-message").val();
      var privateSuggestion = surveyForm.find(".sugesstion-private").is(':checked') ? 1 : 0;
      var suggestion = {
        "suggestion_text": suggestionMessage,
        suggestion_text_private: privateSuggestion
      };
      suggestions.push(suggestion);

      if (this._validateCheer(surveyForm)) {
        var cheers = surveyForm.find('.js-cheersitem').map(function(index, $cheerForm) {
          $cheerForm = $($cheerForm);

          var cheerEmailsData = _.pluck($cheerForm.find("input").select2('data'), 'email');
          var cheerEmails = cheerEmailsData.join(",");
          var cheerAnonymous = $cheerForm.find(".cheer-anonymous").is(':checked') ? 1 : 0;
          var cheerHide = $cheerForm.find(".cheer-hide").is(':checked') ? 1 : 0;
          var cheerMessage = $cheerForm.find(".cheer-message").val();

          var mediaId = $cheerForm.find(".media-image").data("media-id");
          var cheer;
          cheer = {
            "receiver_email": cheerEmails,
            "praise": cheerMessage,
            "anonymous": cheerAnonymous,
            "praise_published": cheerHide == 1 ? 0 : 1,
            "hide_from_feed": cheerHide
          };
          if (mediaId > 0) {
            cheer.media_id = mediaId;
          }

          return cheer;
        });

        var data = {
          email: receiverEmail,
          password: receiverPassword,
          responses: [],
          cheers: cheers.toArray(),
          suggestions: suggestions
        };

        this.loader.show(this.$el);

        var enableHandler = _.bind(function() {
          $(event.target).prop('disabled', false);
          this.loader.hide();
        }, this);

        Api.submitInitialSurvey(GlobalState.getParamFromUrl('signup_token'), JSON.stringify(data))
          .done(_.bind(function(data) {
            if (data.expired) {
              toastr.error(I18n.t('messages.surveys.errors.expired'));
              enableHandler();
            } else if (_.contains(['FAILED', 400, 'UNAUTHORIZED'], data.status)) {
              toastr.error(data.message);
              enableHandler();
            } else {
              window.location.href = "/livepulse";
              return;
            }
          }, this))
          .fail(_.bind(function() {
            enableHandler();
          }, this));
      } else {
        $(event.target).prop('disabled', false);
      }
    },

    _refreshDashboardData: function(whichOptions) {
      whichOptions = whichOptions || {};
      whichOptions.callback = whichOptions.callback || function() {};

      Api.getDashboardDataByResponseToken(whichOptions.response_token)
        .done(_.bind(function(newDashboardData) {

          GlobalState.setDashboardData(newDashboardData);
          this.dashboard = newDashboardData;

          Api.getAdminSettings(newDashboardData.responses[0].response_token).done(function(settingsData) {
            GlobalState.setSettingsData(_.clone(Constants.ADMIN_CONTROLS.DEFAULT_STATE));
            GlobalState.setSettingsData(settingsData.admin_setting);

            RouterHelper.setSearchParams($.param({
              response_token: newDashboardData.responses[0].response_token,
              current_week: "yes"
            }), {
              cancelReload: true
            });

            whichOptions.callback(newDashboardData);
          });

        }, this));
    },

    _validateEmailAndPassword: function($surveyForm) {
      var email = $surveyForm.find('.receiver-email').val();
      var password = $surveyForm.find(".receiver-password");

      if (email.trim().length === 0 || password.val().trim().length === 0) {
        toastr.error(I18n.t('messages.surveys.errors.emptyEmailOrPassword'), '', {
          timeOut: 5000
        });
        return false;
      }

      if (!Utils.isEmail(email)) {
        toastr.error(I18n.t('messages.surveys.errors.invalidEmail'));
        return false;
      }

      if (password[0].checkValidity() === false) {
        toastr.error(I18n.t('messages.authentication.signup.errors.invalidPassowrd'));
        password.focus();
        return false;
      }

      return true;
    },

    _validateCheer: function(surveyForm) {
      var cheerEmailsData = _.pluck(surveyForm.find(".js-cheersitem input").select2('data'), 'email');
      var cheerEmails = cheerEmailsData.join(",");
      var cheerMessage = surveyForm.find(".cheer-message").val();
      if (cheerEmails.trim().length > 0) {
        if (cheerMessage.trim().length === 0) {
          toastr.error(I18n.t('messages.surveys.errors.emptyCheerMessage'));
          return false;
        }
        return true;
      }
      if (cheerMessage.trim().length > 0) {
        if (cheerEmails.trim().length === 0) {
          toastr.error(I18n.t('messages.surveys.errors.emptyCheerReceiver'));
          return false;
        }
      }

      return true;
    },

    _autoResizeTextArea: Utils.resizeTextAreaToOrigin
  });
});
